import React from "react";

const Hero = () => {
  const backgroundStyle = {
    backgroundImage: `url('images/Vector.png')`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  //   const backgroundStyleIcon = {
  //     backgroundImage: `url('/images/icon 2.png')`,
  //     backgroundSize: "cover",
  //     backgroundRepeat: "no-repeat",
  //   };
  return (
    <div style={backgroundStyle} className="h-[675px] ">
      <div className="flex gap-16  text-white justify-center items-center p-10">
        <span className="contrast-75">Home</span>
        <span className="contrast-75">About Us</span>
        <span className="contrast-75">Solutions</span>
        <span>
          <img src="images/logo 1.png" alt="logo" />
        </span>
        <span className="contrast-75">Blogs</span>
        <span className="contrast-75">Trials</span>
        <span className="contrast-75">Contact Us</span>
      </div>
      <div className="flex justify-center items-center">
        <div className="flex flex-col mt-10 items-center">
          <span className="relative">
            <img src="images/icon 2.png" alt=" logo" />
          </span>
          <span className="text-white text-5xl absolute mt-8 text-center">
            Access Innovative <br />
            Healthcare
          </span>
          <span className="text-white absolute mt-44 contrast-50 text-center">
            Empowering primary care professionals to seamlessly identify and
            engage <br /> with eligible patients for clinical trail
            opportunities.
          </span>
        </div>
      </div>
    </div>
  );
};

export default Hero;
